/**
 * @title SimpleStaking
 * @dev A contract with tokenB staking and tokenA/tokenB swap functionality
 */
contract SimpleStaking {
    // Token addresses
    address public tokenA;
    address public tokenB;

    // Mapping to track each user's staked tokenB balance
    mapping(address => uint256) public stakedBalance;

    // Mapping to track each user's deposited tokenB balance (for swap liquidity)
    mapping(address => uint256) public depositedBalance;

    // Total amount of tokenB staked
    uint256 public totalStaked;

    // Total amount of tokenB deposited for swaps
    uint256 public totalDeposited;

    // Events
    event Staked(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event Deposited(address indexed user, uint256 amount);
    event Swapped(address indexed user, uint256 amountIn, uint256 amountOut);

    /**
     * @dev Constructor to set token addresses
     * @param _tokenA Address of token A
     * @param _tokenB Address of token B
     */
    constructor(address _tokenA, address _tokenB) {
        require(_tokenA != address(0), "Invalid tokenA address");
        require(_tokenB != address(0), "Invalid tokenB address");
        tokenA = _tokenA;
        tokenB = _tokenB;
    }

    /**
     * @dev Deposit tokenB into the contract to provide swap liquidity
     * @param amount The amount of tokenB to deposit
     */
    function deposit(uint256 amount) external {
        require(amount > 0, "Must deposit more than 0");

        // Transfer tokenB from user to contract
        require(
            IERC20(tokenB).transferFrom(msg.sender, address(this), amount),
            "TokenB transfer failed"
        );

        depositedBalance[msg.sender] += amount;
        totalDeposited += amount;

        emit Deposited(msg.sender, amount);
    }

    /**
     * @dev Stake tokenB into the contract
     * @param amount The amount of tokenB to stake
     */
    function stake(uint256 amount) external {
        require(amount > 0, "Must stake more than 0");

        // Transfer tokenB from user to contract
        require(
            IERC20(tokenB).transferFrom(msg.sender, address(this), amount),
            "TokenB transfer failed"
        );

        stakedBalance[msg.sender] += amount;
        totalStaked += amount;

        emit Staked(msg.sender, amount);
    }

    /**
     * @dev Withdraw staked tokenB
     * @param amount The amount to withdraw
     */
    function withdraw(uint256 amount) external {
        require(amount > 0, "Must withdraw more than 0");
        require(stakedBalance[msg.sender] >= amount, "Insufficient staked balance");

        stakedBalance[msg.sender] -= amount;
        totalStaked -= amount;

        // Transfer tokenB from contract back to user
        require(
            IERC20(tokenB).transfer(msg.sender, amount),
            "TokenB transfer failed"
        );

        emit Withdrawn(msg.sender, amount);
    }

    /**
     * @dev Swap tokenA for tokenB (1:1 ratio)
     * User sends tokenA and receives tokenB from deposited liquidity
     * @param amount The amount of tokens to swap
     */
    function swap(uint256 amount) external {
        require(amount > 0, "Must swap more than 0");

        // Check contract has enough tokenB in deposited pool
        require(totalDeposited >= amount, "Insufficient tokenB liquidity");

        // Transfer tokenA from user to contract
        require(
            IERC20(tokenA).transferFrom(msg.sender, address(this), amount),
            "TokenA transfer failed"
        );

        // Transfer tokenB from contract to user
        require(
            IERC20(tokenB).transfer(msg.sender, amount),
            "TokenB transfer failed"
        );

        // Reduce total deposited since tokenB was sent out
        totalDeposited -= amount;

        emit Swapped(msg.sender, amount, amount);
    }

    /**
     * @dev Get the staked balance of a user
     * @param user The address to check
     * @return The staked tokenB balance
     */
    function getStakedBalance(address user) external view returns (uint256) {
        return stakedBalance[user];
    }

    /**
     * @dev Get the deposited balance of a user
     * @param user The address to check
     * @return The deposited tokenB balance
     */
    function getDepositedBalance(address user) external view returns (uint256) {
        return depositedBalance[user];
    }

    /**
     * @dev Get the contract's token balance
     * @param token The token address to check
     * @return The token balance
     */
    function getTokenBalance(address token) external view returns (uint256) {
        return IERC20(token).balanceOf(address(this));
    }
